script: |
  super -f text -I q10809.spq | sort > q10809.out

inputs:
  - name: q10809.spq
    data: |
      SELECT col1 / CAST ( NULL AS INTEGER ) AS col0 FROM tab1 (FORMAT parquet) WHERE ( NOT + col2 + col2 + ( col1 ) / col0 * + + col0 < col0 * - col0 * - col2 * + col2 / - + CAST ( NULL AS INTEGER ) + - 94 + col0 + - col0 * + 13 );
  - name: tab1

outputs:
  - name: q10809.out
    data: |
